import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { gapi } from "gapi-script";

import "./App.css";

import { Login, LoginGoogle } from "./components/Login/login";

import Logout from "./components/Login/logout";
import Header from "./components/Header/Header";
import ItemList from "./components/ProductList/Item";

const clientId =
  "65793818011-ggo7gienivg0jn9j0kfno8t37c7infam.apps.googleusercontent.com";

class App extends Component {
  componentDidMount() {
    this.startGapi();
  }

  startGapi() {
    gapi.load("client:auth2", () => {
      gapi.client.init({
        clientId: clientId,
        scope: "",
      });
    });
  }

  render() {
    return (
      <Router>
        <div className="App">
          <header className="App-header">
            <Switch>
              <Route path="/login" component={Login} />
              <Route path="/">
                <Header />
                <ItemList />
              </Route>
            </Switch>
          </header>
        </div>
      </Router>
    );
  }
}

export default App;
